import React, { useState } from 'react';
import GalleryModal from './GalleryModals'; // We will create this next
import './Gallery.css';

// --- DATA STRUCTURE ---
// An array of arrays. Each inner array is a row of cards.
const galleryData = [
  // Row 1
  [
    { id: 1, title: 'Historic Cityscapes', imageUrl: 'https://images.unsplash.com/photo-1502602898657-3e91760c0341?w=500&q=80' },
    { id: 2, title: 'Parisian Nights', imageUrl: 'https://images.unsplash.com/photo-1522093007474-d86e9bf7ba6f?w=500&q=80' },
    { id: 3, title: 'Ancient Rome', imageUrl: 'https://images.unsplash.com/photo-1525874684015-58379d421a52?w=500&q=80' },
    { id: 4, title: 'Venetian Canals', imageUrl: 'https://images.unsplash.com/photo-1518628325950-d53219853925?w=500&q=80' },
  ],
  // Row 2
  [
    { id: 5, title: 'Mountain Retreats', imageUrl: 'https://images.unsplash.com/photo-1464822759023-fed622ff2c3b?w=500&q=80' },
    { id: 6, title: 'Alpine Majesty', imageUrl: 'https://images.unsplash.com/photo-1506905925346-21bda4d32df4?w=500&q=80' },
    { id: 7, title: 'Snowy Peaks', imageUrl: 'https://images.unsplash.com/photo-1549880338-65ddcdfd017b?w=500&q=80' },
    { id: 8, title: 'Misty Mornings', imageUrl: 'https://images.unsplash.com/photo-1485470733090-0aae1788d5af?w=500&q=80' },
    { id: 9, title: 'Hiking Trails', imageUrl: 'https://images.unsplash.com/photo-1458442310124-05424337147c?w=500&q=80' },
  ],
  // Row 3
  [
    { id: 10, title: 'Oceanic Wonders', imageUrl: 'https://images.unsplash.com/photo-1509316975850-ff9c5deb0cd9?w=500&q=80' },
    { id: 11, title: 'Coral Reefs', imageUrl: 'https://images.unsplash.com/photo-1551296336-55d81b459427?w=500&q=80' },
    { id: 12, title: 'Coastal Views', imageUrl: 'https://images.unsplash.com/photo-1439405326854-014607f694d7?w=500&q=80' },
  ],
  // Add more rows as needed...
  // Row 4
  [
    { id: 13, title: 'Forest Adventures', imageUrl: 'https://images.unsplash.com/photo-1448375240586-882707db888b?w=500&q=80' },
    { id: 14, title: 'Redwood Giants', imageUrl: 'https://images.unsplash.com/photo-1542848135-ce9674066903?w=500&q=80' },
    { id: 15, title: 'Sunlit Woods', imageUrl: 'https://images.unsplash.com/photo-1425913397330-cf8af2ff40a1?w=500&q=80' },
    { id: 16, title: 'Autumn Leaves', imageUrl: 'https://images.unsplash.com/photo-1476842634003-7d0280421421?w=500&q=80' },
  ],
   // Row 5
  [
    { id: 17, title: 'Desert Landscapes', imageUrl: 'https://images.unsplash.com/photo-1473580044384-7ba9967e16a0?w=500&q=80' },
    { id: 18, title: 'Canyon Vistas', imageUrl: 'https://images.unsplash.com/photo-1443632864897-14973fa006cf?w=500&q=80' },
    { id: 19, title: 'Dune Patterns', imageUrl: 'https://images.unsplash.com/photo-1487621814324-9a37f5492d34?w=500&q=80' },
  ],
  // Row 6
  [
    { id: 20, title: 'Urban Exploration', imageUrl: 'https://images.unsplash.com/photo-1480714378408-67cf0d136b79?w=500&q=80' },
    { id: 21, title: 'Neon City', imageUrl: 'https://images.unsplash.com/photo-1534430480872-3498386e7856?w=500&q=80' },
    { id: 22, title: 'Skyscrapers', imageUrl: 'https://images.unsplash.com/photo-1523978591478-6ff514888201?w=500&q=80' },
    { id: 23, title: 'Street Level', imageUrl: 'https://images.unsplash.com/photo-1519501025264-65ba15a82390?w=500&q=80' },
    { id: 24, title: 'Metropolis', imageUrl: 'https://images.unsplash.com/photo-1449824913935-59a10b8d2000?w=500&q=80' },
  ]
];

const BackArrowIcon = ({ onClick }) => (
  <div className="back-arrow" onClick={onClick} title="Collapse Row">
    <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="currentColor">
      <path d="M10.8284 12.0007L15.7782 16.9504L14.364 18.3646L8 12.0007L14.364 5.63672L15.7782 7.05093L10.8284 12.0007Z"></path>
    </svg>
  </div>
);


function Gallery() {
  const [expandedRowIndex, setExpandedRowIndex] = useState(null);
  const [modalState, setModalState] = useState({ isOpen: false, rowIndex: null, cardIndex: null });

  const handleRowClick = (rowIndex) => {
    setExpandedRowIndex(prevIndex => (prevIndex === rowIndex ? null : rowIndex));
  };

  const handleCollapseRow = (e) => {
    e.stopPropagation(); // Prevent card click event
    setExpandedRowIndex(null);
  };

  const handleCardClick = (e, rowIndex, cardIndex) => {
    // Only open modal if the row is expanded
    if (expandedRowIndex === rowIndex) {
      e.stopPropagation(); // Prevent row click event
      setModalState({ isOpen: true, rowIndex, cardIndex });
    }
  };

  const closeModal = () => {
    setModalState({ isOpen: false, rowIndex: null, cardIndex: null });
  };

  return (
    <>
      <div className="gallery-wrapper">
        {galleryData.map((row, rowIndex) => (
          <div
            key={rowIndex}
            className={`card-row ${expandedRowIndex === rowIndex ? 'is-expanded' : ''}`}
          >
            <ul
              className="card-stack"
              onClick={() => handleRowClick(rowIndex)}
            >
              {row.map((card, cardIndex) => (
                <li
                  key={card.id}
                  className="card"
                  style={{ '--index': cardIndex }}
                  onClick={(e) => handleCardClick(e, rowIndex, cardIndex)}
                >
                  {/* Conditionally render the back arrow on the first card of an expanded row */}
                  {expandedRowIndex === rowIndex && cardIndex === 0 && (
                    <BackArrowIcon onClick={handleCollapseRow} />
                  )}
                  <img src={card.imageUrl} alt={card.title} />
                </li>
              ))}
            </ul>
          </div>
        ))}
      </div>

      <GalleryModal
        isOpen={modalState.isOpen}
        onClose={closeModal}
        galleryData={galleryData}
        initialState={modalState}
      />
    </>
  );
}

export default Gallery;
